// Function to parse CSV data and populate table
function parseCSV() {
    var lines = csvData.split("\n");
    var table = document.getElementById("dataTable");
    for (var i = 1; i < lines.length; i++) { // Start from index 1 to skip the header line
        var cells = lines[i].split(",");
        var row = table.insertRow(-1);
        for (var j = 0; j < cells.length; j++) {
            var cell = row.insertCell(-1);
            cell.textContent = cells[j];
        }
    }
}

// Call parseCSV function to populate the table
parseCSV();

function searchTable() {
    var input, filter, table, tr, td, i, txtValue;
    input = document.getElementById("searchInput");
    filter = input.value.toUpperCase();
    table = document.getElementById("dataTable");
    tr = table.getElementsByTagName("tr");
    for (i = 1; i < tr.length; i++) { // Start from index 1 to skip the header row
        td = tr[i].getElementsByTagName("td");
        var rowMatch = false;
        for (var j = 0; j < td.length; j++) {
            if (td[j]) {
                txtValue = td[j].textContent || td[j].innerText;
                if (filter.length >= 3 && txtValue.toUpperCase().indexOf(filter) > -1) {
                    rowMatch = true;
                    break;
                }
            }
        }
        if (filter.length >= 3 && rowMatch) {
            tr[i].style.display = "";
        } else {
            tr[i].style.display = "none";
        }
    }
}

function clearTable() {
    var table = document.getElementById("dataTable");
    var tr = table.getElementsByTagName("tr");
    for (var i = 1; i < tr.length; i++) { // Start from index 1 to skip the header row
        tr[i].style.display = "none";
    }
    document.getElementById("searchInput").value = "";
}

window.onload = function() {
    clearTable();
}
</script>
